import React from 'react'
import data from '../businesses.json'

export default function BusinessMap() {




    const map = data.map((business) => {

        const fakeRedirect = (name) => {
            alert('Redirecting to ' + name)
        }


        const tagMap = business.businessType.map((bus) => {
            return (<li className="horizontal-li list"> 
                        <a href="#"> #{bus} </a>
                    </li>)
        })

        return (
                    <li key={business.distance} className="list side-card" onClick={fakeRedirect(business.name)}>
                        <div className="side-card">
                            <h5>
                                {business.name}
                            </h5>
                            <p>
                                {business.address}
                            </p>
                            <div> 
                                <ul className="horizontal">   
                                    {tagMap}
                                </ul> 
                            </div>
                        </div>
                    </li>
            )
        }
    )

    return (
        <ul>
            {map}
        </ul>
    )
}
